import { useState } from 'react';
import MoviesList from '../components/Movies/MoviesList';
function Favorites() {
  const [favoriteMovies, setFavoriteMoviesList] = useState([]);
  return <MoviesList movies={favoriteMovies} />;
}
export default Favorites;
